export function viewGame(gameId) {
  console.log(gameId);

  setInterval(function () {
    fetch(
      `https://www.balldontlie.io/api/v1/games?per_page=100&game_ids=${gameId}`
    )
      .then((res) => res.json())
      .then(
        (result) => {
          console.log(result);
        },
        (error) => {
          console.log(error);
        }
      );
  }, 45000);
}
